aWLICashValueProduct.Description:
{\rtf1\ansi\ansicpg1252\deff0\deflang1033\deflangfe1033{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}}
\viewkind4\uc1\pard\lang2057\f0\fs20 Universal life insurance (often shortened to UL) is a type of permanent life insurance based on a cash value. That is, the policy is established with the insurer where premium payments above the cost of insurance are credited to the cash value of the policy. The cash value is credited each month with interest, and the policy is debited each month by a cost of insurance (COI) charge, as well as any other policy charges and fees which are drawn from the cash value if no premium payment is made that month. The interest credited to the account is determined by the insurer; sometimes it is pegged to a financial index such as a bond or other interest rate index.\par
}

{\rtf1\ansi\ansicpg1252\deff0\deflang1033\deflangfe1033{\fonttbl{\f0\fswiss\fprq2\fcharset0 Arial;}}
\viewkind4\uc1\pard\lang2057\f0\fs20 Variable Life insurance (often shortened to VL) is a type of permanent life insurance based on a cash value. That is, the policy is established with the insurer where deposits can be invested in investment funds. The cash value depends on the possess units and their value on the market and the rest of deposit amount not invested. The policy is debited each month by a cost of insurance (COI) charge, as well as any other policy charges and fees which are drawn from the cash value if there is no amount left on the available amount of the multiple investment account (MIA). The units generated dividends over time that are credited to the  interest credited to the MIA account, added in its availbable amount.\par
}
